import { Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import NowPlaying from "./components/movieMenu/NowPlaying";
import NavBar from "./components/NavBar";

function App() {
  return (
    <Routes>
      <Route element={<NavBar />} />
      <Route path="/" element={<Home />} />
      <Route path="/now/playing/movies" element={<NowPlaying />}></Route>
    </Routes>
  );
}

export default App;
